import './Logout.css';
import { IoIosPower } from 'react-icons/io';
import { signOut } from 'firebase/auth';
import { auth } from '../../../firebase';
import { useNavigate } from 'react-router-dom';


// Export Logout view
export default function ReturnLogout() {

 const navigation = useNavigate();
 const handleLogout = async (event) => {
  event.preventDefault();
  await signOut(auth).then(() => {
   window.alert('Deconnexion user');
   navigation('/');

  }).catch((error) => {
   window.alert('Not deconnxion user!')
  })
  // Sign out succesfull user

 };
 return (
  <div onClick={handleLogout} className='wrp-logout-dash'>
   <IoIosPower size={'1.2em'} color='#e91e63' />
  </div>
 );
};
